import searchLogo from './search.svg';
import colourInverter from './ColourInverter.svg';
import './header.css';
import './main.css';

function Utilities() {
  return (
    <div className="header__utilities">
      <img className="header__utilitiesSVG" src={searchLogo} alt={searchLogo} />
      <img className="header__utilitiesSVG" src={colourInverter} alt={colourInverter} />
    </div>

  );
}

document.colourInverter.addEventListener('click', function () {
  var colourOne = document.documentElement.style.getPropertyValue('--primary-colour');
  var colourTwo = document.documentElement.style.getPropertyValue('--secondary-colour');

  document.documentElement.style.setProperty('--primary-colour', colourTwo);
  document.documentElement.style.setProperty('--secondary-colour', colourOne);
})

export default Utilities;
